NSTRUCTIONS\nThis form is only for studies that will be reviewed by the UW IRB. Before completing this form, check HSD’s website to confirm that this should not be reviewed by an external (non-UW) IRB.\nIf you are requesting a determination about whether the planned activity is human subjects research or qualifies for exempt status, you may skip all questions except those marked with [DETERMINATION] For example 1.1. [DETERMINATION] must be answered. Do not upload consent materials for determinations in Zipline as HSD does not review or approve them.\nAnswer all questions. If a question is not applicable to the research or if you believe you have already answered a question elsewhere in the application, state “NA” (and if applicable, refer to the question where you provided the information). If you do not answer a question, the IRB does not know whether the question was overlooked or whether it is not applicable. This may result in unnecessary “back and forth” for clarification. Use non-technical language as much as possible. \nFor collaborative or multi-site research, describe only the UW activities unless you are requesting that the UW IRB provide the review and oversight for non-UW collaborators or co-investigators as well. \nYou may reference other documents (such as a grant application) if they provide the requested information in non-technical language. Be sure to provide the document name, page(s), and specific sections, and upload it to Zipline. Also, describe any changes that may have occurred since the document was written (for example, changes that you’ve made during or after the grant review process). In some cases, you may need to provide additional details in the answer space as well as referencing a document. \nNOTE: Do not convert this Word document to PDF. The ability to use “tracked changes” is required in order to modify your study and respond to screening requests\nINDEX\n1. Overview\n2. Participants\n3. Non-UW Research Setting\n4. Recruiting and ally-imposed urgency that is beyond the control of the researcher. Researchers are encouraged to communicate as soon as possible with their HSD staff contact person when there is an urgent situation (in other words, before submitting the IRB application). Examples: a researcher plans to test an experimental vaccine that has just been developed for a newly emerging epidemic; a researcher has an unexpected opportunity to collect data from students when the end of the school year is only four weeks away. \nHSD may ask for documentation of the externally-imposed urgency. A higher priority should not be requested to compensate for a researcher’s failure to prepare an IRB application in a timely manner. Note that IRB review requires a certain minimum amount of time; without sufficient time, the IRB may not be able to review and approve an application by a deadline.\n☐ No\n☒ Yes → Briefly describe the urgency or deadline as well as the reason for it.\n\u0010\u0012\u001cThe newly-funded multisite NIH study requires IRB approval within 6 months of the funding receipt.\n\u00111.5. [DETERMINATION]  Objectives. Using lay language, describe the purpose, specific aims, or objectives that will be met by this specific project. If hypotheses are being tested, describe them. You will be asked to describe the specific procedures in a later section.\nIf this application involves the use of a HUD “humanitarian” device: describe whether the use is for “on-label” clinical patient care, “off-label” clinical patient care, and/or research (collecting safety and/or effectiveness data).\n\u0010\u0012\u001cThe study will collect a cross-sectional dataset of 4600 people across the US from diverse racial/ethnic groups who are either 1) healthy, or 2) belong in one of the three stages of diabetes severity (pre-diabetes/diet controlled, oral medication and/or non-insulin-injectable medication controlled, or insulin dependent), forming a total of four groups of patients. Clinical data (social determinants of health surveys/PhenX surveys, continuous glucose monitoring data, biomarkers, genetic data, retinal imaging, cognitive testing, etc.) will be collected. The purpose of this project is data generation to allow future creation of artificial intelligence/machine learning (AI/ML) algorithms aimed at defining disease trajectories and underlying genetic links in different racial/ethnic cohorts. A smaller subgroup of participants will be invited to come for a follow-up visit in year 4 of the project (longitudinal arm of the study). Data will be placed in an open-source repository and samples will be sent to the study sample repository and used for future research.\n\u0011"},{"ty":"ae","et":"bookmark","id":"id.9owpjjhhhl6u","epm":{}},{"ty":"ae","et":"bookmark","id":"id.d43qfr1fm8ar","epm":{}},{"ty":"ae","et":"bookmark","id":"id.hfaa6736zi8c","epm":{}},{"ty":"te","id":"id.9owpjjhhhl6u","spi":4135},{"ty":"te","id":"id.d43qfr1fm8ar","spi":6566},{"ty":"te","id":"id.hfaa6736zi8c","spi":5082},{"ty":"as","st":"tbl","si":4106,"ei":4106,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":474.0,"col_wt":0,"col_tdt":{"tdt_v":0},"col_tf":{"ttf_vn":0,"ttf_n":""}}]}},"tbls_cfwt":{"cfmt_cg":{"cellgp_pt":0.0,"cellgp_bt_i":false,"cellgp_pl_i":false,"cellgp_va":2,"cellgp_bl":{"brdr_c2":{"hclr_color":"#000000","clr_type":0},"brdr_s":0.0,"brdr_w":0.5,"brdr_ls":0},"cellgp_biv_i":false,"cellgp_pb_i":false,"cellgp_pl":5.4,"cellgp_bb":{"brdr_c2":{"hclr_color":"#000000","clr_type":0},"brdr_s":0.0,"brdr_w":0.5,"brdr_ls":0},"cellgp_bih":{"brdr_c2":{"hclr_color":"#000000","clr_type":0},"brdr_s":0.0,"brdr_w":0.5,"brdr_ls":0},"cellgp_bb_i":false,"cellgp_pr":5.4,"cellgp_va_i":true,"cellgp_pr_i":false,"cellgp_bgc2":{"hclr_color":"","clr_type":0},"cellgp_bih_i":false,"cellgp_bl_i":false,"cellgp_pt_i":false,"cellgp_bgc2_i":true,"cellgp_biv":{"brdr_c2":{"hclr_color":"#000000","clr_type":0},"brdr_s":0.0,"brdr_w":0.5,"brdr_ls":0},"cellgp_br_i":false,"cellgp_br":{"brdr_c2":{"hclr_color":"#000000" ","ts_fgc2":{"hclr_color":"#595959","clr_type":0},"ts_fgc2_i":true,"ts_bgc2":{"hclr_color":null,"clr_type":0}}},{"ty":"as","st":"text","si":11718,"ei":11727,"sm":{"ts_ff_i":true,"ts_un":true,"ts_un_i":false,"ts_bgc2_i":true,"ts_bd_i":true,"ts_ff":"Calibri","ts_fgc2":{"hclr_color":"#595959","clr_type":0},"ts_fgc2_i":true,"ts_bgc2":{"hclr_color":null,"clr_type":0}}},{"ty":"as","st":"text","si":11728,"ei":11955,"sm":{"ts_ff_i":true,"ts_un":true,"ts_un_i":true,"ts_bgc2_i":true,"ts_bd_i":true,"ts_ff":"Calibri","ts_fgc2":{"hclr_color":"#595959","clr_type":0},"ts_fgc2_i":true,"ts_bgc2":{"hclr_color":null,"clr_type":0}}},{"ty":"as","st":"text","si":11956,"ei":12177,"sm":{"ts_un":true,"ts_un_i":true,"ts_it_i":false,"ts_fgc2":{"hclr_color":"#595959","clr_type":0},"ts_bgc2":{"hclr_color":null,"clr_type":0},"ts_fs_i":false,"ts_ff_i":true,"ts_bgc2_i":true,"ts_it":true,"ts_bd_i":true,"ts_fs":10.0,"ts_ff":"Calibri","ts_fgc2_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); DOCS_initialLoadTiming.incrementTime('mp', DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script nonce="u-Ju_h25rM0x5G_-gE637A">DOCS_modelChunkParseStart = new Date().getTime();</script><script nonce="u-Ju_h25rM0x5G_-gE637A">DOCS_modelChunk = [{"ty":"is","ibi":12178,"s":"\u0010\u0012\u001cThe ability to understand and affect the course of complex, multisystem diseases has been limited by a lack of well-designed, high quality, large, and inclusive multimodal datasets. We propose to create such a dataset allowing ML approaches to provide critical insights int the endemic condition, type 2 diabetes mellitus. \n\nOur approach is to collect a cross-sectional dataset of 4,600 people across the US with dual\nbalancing for self-reported race/ethnicity and four stages of diabetes severity. Building balanced\ntraining datasets is critical for the development of unbiased ML models. Approximately 10% of the participants will be invited to return for follow-up data collection. Thus, rather than targeting the demographic distribution of the US population, we intentionally will recruit\nequal numbers of four racial/ethnic groups. The same rationale applies for balancing diabetic severity. AI/ML ready data will include physical measurements, medical history, motor vehicle driving history, health surveys, continuous glucose monitoring, serological testing for endocrine, cardiac, and renal biomarkers, genome-wide polymorphism assessment, visual function testing, retinal imaging, ECG, cognitive testing, 24-hr activity monitoring, and environmental sensing.\n\nThe dataset will be specifically designed to permit downstream pseudotime manifold analysis. This approach has been utilized in developmental biology successfully to identify differentiation pathways from complex gene expression datasets of individual cells. An expanded approach may be used to define disease trajectories by collecting complex, multimodal data from participants with differing disease severity. This approach relies on dimensionality reduction, is agnostic to existing classification criteria or biases, and can be used to reconstruct a temporal atlas of pathogenesis and healing.\n\u00111.8.b. Experience and preliminary work. Briefly describe experience or preliminary work or data (if any) that you, your team, or your collaborators/co-investigators have that supports the feasibility and/or safety of this study.\nIt is not necessary to summarize all discussion that has led to the development of the study protocol. The IRB is interested only in short summaries about experiences or preliminary work that suggest the study is feasible and that risks are reasonable relative to the benefits. Examples: Your team has already conducted a Phase 1 study of an experimental drug which supports the Phase 2 study being proposed in this application; your team has already done a small pilot study showing that the reading skills intervention described in this application is feasible in an after-school program with classroom aides; your team has experience with the type of surgery that is required to implant the study device; the study coordinator is experienced in working with subjects who have significant cognitive impairment.\n\u0010\u0012\u001cThe study team includes a diverse group of investigators from multiple institutions across the US. Data collection will take place at the University of Washington (UW), the University of Alabama Birmingham (UAB), and the University of California San Diego (UCSD). In the process of preparing the proposal for NIH funding and in planning the study protocol, we have had numerous meetings as well as asynchronous communication to assess the feasibility and safety of the protocol. Investigators at all sites have had prior experience with the proposed study procedures. The ophthalmic imaging devices are non-invasive and do not pose significant risk to the participants. We have teams of study coordinators and research personnel with extensive prior experience conducting research study visits and experience working with participants from an array of diverse backgrounds.\n\u00111.9. Supplements. Check all boxes that apply, to identify relevant SUPPLEMENTS that should be completed and uploaded to Zipline.\nThis section is here instead of at the end of the form to reduce the risk of duplicating information in this IRB Protocol form that you will need to provide in these Supplements.\n"},{"ty":"ae","et":"bookmark","id":"id.jr7chzo3zdmy","epm":{}},{"ty":"ae","et":"bookmark","id":"id.qst91ffs66s5","epm":{}},{"ty":"te","id":"id.jr7chzo3zdmy","spi":14051},{"ty":"te","id":"id.qst91ffs66s5","spi":15970},{"ty":"as","st":"tbl","si":12178,"ei":12178,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":489.0,"col_wt":0,"col_tdt":{"tdt_v":0},"col_tf":{"ttf_vn":0,"ttf_n":""}}]}},"tbls_cfwt":{"cfmt_cg":{"cellgp_pt":0.0,"cellgp_bt_i":false,"cellgp_pl_i":false,"cellgp_  used through a clinical facility in the manner for which it is approved.\n\u001cSUPPLEMENT Devices\n\u0012\u001c☒\n\u001cMulti-site or collaborative study\nThe UW IRB is being asked to review on behalf of one or more non-UW institutions in a multi-site or collaborative study.\n\u001cSUPPLEMENT Multi-site or Collaborative Research\n\u0012\u001c☐\n\u001cNon-UW Individual Investigators\nThe UW IRB is being asked to review on behalf of one or more non-UW individuals who are not affiliated with another organization for the purpose of the research.\n\u001cSUPPLEMENT Non-UW Individual Investigators\n\u0012\u001c☐\n\u001cOther REDCap Installation Attestation for Electronic Consent\nThe research will use a non-UW installation of REDCap for conducting and/or documenting informed consent.\n\u001cSUPPLEMENT Other REDCap Installation\n\u0012\u001c☐\n\u001cNone of the above.\n\u001c\n\u00111.10. [DETERMINATION]  Confirm by checking the box below that you will comply with the COVID requirements described on HSD’s COVID webpage, which are based on the location of the in-person study procedures and the vaccination status of study team members and study participants.\nReview the HSD website for current guidelines about which in-person research activities are allowable.\n☒ Confirmed\n2. PARTICIPANTS\n2.1. [DETERMINATION]  Participants. Describe the general characteristics of the subject populations or groups, including age range, gender, health status, and any other relevant characteristics.\n\u0010\u0012\u001cAdult patients will be recruited into one of four groups: 1) healthy/no diabetes, 2) pre-diabetes/borderline diabetes/diet-controlled diabetes, 3) oral medication and/or non-insulin injectable medication  controlled type 2 diabetes, or 4) insulin dependent type 2 diabetes. We aim to recruit approximately 1000 patients into each of the four groups. Patients will be recruited from University of Washington (UW), University of California at San Diego (UCSD), and University of Alabama at Birmingham (UAB). The study aims to recruit 1,000 subjects from each of the following racial and ethnic groups: white, Asian, Hispanic, and Black. Subjects will be age- and sex-matched within and between groups.\n\nNote; We are submitting an NIH supplement to obtain funding for translation of all study materials to enable recruitment and participation of Spanish-speaking participants who are no fluent in English. Hispanic participants enrolled in the meantime will need to be fluent in English to participate.\n\u00112.2. [DETERMINATION]  Inclusion and exclusion criteria.\n2.2.a. Inclusion criteria. Describe the specific criteria that will be used to decide who will be included in the research from among interested or potential subjects. Define any technical terms in lay language.\n\u0010\u0012\u001cAdults (≥ 40 years old)\nPatients with and without type 2 diabetes\nAble to provide consent\nMust be able to read and speak English\n\u0011"},{"ty":"ae","et":"bookmark","id":"id.4ubbx4mki0ge","epm":{}},{"ty":"ae","et":"bookmark","id":"id.79ztxywfk96a","epm":{}},{"ty":"ae","et":"bookmark","id":"id.j6pg22d5z222","epm":{}},{"ty":"ae","et":"bookmark","id":"id.tt8zr16zn64c","epm":{}},{"ty":"ae","et":"bookmark","id":"id.yv3r9notkhcp","epm":{}},{"ty":"te","id":"id.4ubbx4mki0ge","spi":18339},{"ty":"te","id":"id.79ztxywfk96a","spi":19948},{"ty":"te","id":"id.j6pg22d5z222","spi":18733},{"ty":"te","id":"id.tt8zr16zn64c","spi":18749},{"ty":"te","id":"id.yv3r9notkhcp","spi":20004},{"ty":"as","st":"tbl","si":16278,"ei":16278,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":58.5,"col_wt":0,"col_tdt":{"tdt_v":0},"col_tf":{"ttf_vn":0,"ttf_n":""}},{"col_wv":324.0,"col_wt":0,"col_tdt":{"tdt_v":0},"col_tf":{"ttf_vn":0,"ttf_n":""}},{"col_wv":139.25,"col_wt":0,"col_tdt":{"tdt_v":0},"col_tf":{"ttf_vn":0,"ttf_n":""}}]}},"tbls_cfwt":{"cfmt_cg":{"cellgp_pt":0.0,"cellgp_bt_i":false,"cellgp_pl_i":false,"cellgp_va":2,"cellgp_bl":{"brdr_c2":{"hclr_color":"#000000","clr_type":0},"brdr_s":0 ry and their cultural or historical distinctiveness from other populations that are often politically dominant.\nExamples: a reservation school or health clinic; recruiting during a tribal community gathering.\n☒ No\n☐ Yes → Name the tribe, tribal-focused organization, or similar community-based organization. The UW IRB expects that tribal/indigenous approval will be obtained before beginning the research. This may or may not involve approval from a tribal IRB. The study team and any collaborators/investigators are also responsible for identifying any tribal laws that may affect the research.\n\u0010\u0012\u001c\n\u00112.7.\t[DETERMINATION]  UW Medicine and UW Dentistry residents and fellows. Will the research involve UW Medicine or UW Dentistry residents or fellows as study subjects? \n☒ No\n☐ Yes → (1) Describe in the Recruiting section (4.1) and Risks section (10.1) how you will ensure that residents feel free to truly make a voluntary decision about participation (i.e., no negative consequences from supervisors for saying “No”) and how you will ensure that any research data will not be used in the residents’ supervisor or program evaluation of them; AND (2) You must inform the UW HR Labor Relations representative who negotiates with the resident’s union about the study before beginning it. This is currently Jennifer Mallahan mallaj@uw.edu . \n2.8.\t [DETERMINATION]  Third party subjects. Will the research collect private identifiable information about individuals other than the study subjects? Common examples include: collecting medical history information or contact information about family members, friends, co-workers.\n“Identifiable” means any direct or indirect identifier that, alone or in combination, would allow you or another member of the research team to readily identify the person. For example, suppose that the research is about immigration history. If subjects are asked questions about their grandparents but are not asked for names or other information that would allow easy identification of the grandparents, then private identifiable information is not being collected about the grandparents and the grandparents are not subjects.\n☒ No\n☐ Yes → These individuals are considered human subjects in the study. Describe them and what data will be collected about them.\n\u0010\u0012\u001c\n\u00112.9. Number of subjects. Is it possible to predict or describe the maximum number of subjects (or subject units) needed to complete the study, for each subject group?\nSubject units mean units within a group. For most research studies, a group will consist of individuals. However, the unit of interest in some research is not the individual. Examples:\nDyads such as caregiver-and-Alzheimer’s patient, or parent and child\nFamilies\nOther units, such as student-parent-teacher\nSubject group means categories of subjects that are meaningful for the specific study. Some research has only one subject group – for example, all UW students taking Introductory Psychology. Some common ways in which subjects are grouped include:\nBy intervention – for example, an intervention group and a control group.\nBy subject population or setting – for example, urban versus rural families\nBy age – for example, children who are 6, 10, or 14 years old.\nThe IRB reviews the number of subjects in the context of risks and benefits. Unless otherwise specified, if the IRB determines that the research involves no more than minimal risk: there are no restrictions on the total number of subjects that may be enrolled. If the research involves more than minimal risk: The number of enrolled subjects must be limited to the number described in this application. If it is necessary later to increase the number of subjects, submit a Modification. Exceeding the IRB-approved number (over-enrollment) will be considered non-compliance.\n☐ No → Provide the rationale in the box below. Also, provide any other available information about the scope/size of the research. You do o enter text.\n\u00113. NON-UW RESEARCH SETTINGS\nComplete this section only if UW investigators and people named in the SUPPLEMENT Non-UW Individual Investigators will conduct research procedures outside of UW and Harborview\n3.1. [DETERMINATION]  Research locations and rationale. Identify the locations where the research will be conducted and include a description of the reason(s) for choosing the locations. If the research will be conducted internationally, be sure to list all the countries where the research will take place.\nThis is especially important when the research will occur in locations or with populations that may be vulnerable to exploitation. One of the three ethical principles the IRB must consider is Justice: ensuring that reasonable, non-exploitative, and well-considered procedures are administered fairly, with a fair distribution of costs and potential benefits.\n\u0010\u0012\u001cThe research sites have been chosen based on strong prior experience with conducting longitudinal clinical research studies, experience with ophthalmic study procedures, and available collaborators with commitment to participation. All three sites will recruit people of diverse backgrounds. However, based on local/regional demographics, UW will concentrate in recruiting Asian\u003eHispanic\u003eBlack participants, while the University of California at San Diego site will prioritize Hispanic\u003eAsian\u003eBlack participants, and the University of Alabama at Birmingham site will prioritize Black\u003eHispanic\u003eAsian participants. All sites will recruit white participants. All race and ethnicity information will be self-reported at the time of screening and enrollment.\n\u00113.2. [DETERMINATION]  Local context. Culturally appropriate procedures and an understanding of local context are an important part of protecting subjects. Describe any site-specific cultural issues, customs, beliefs, or values that may affect the research, how it is conducted, or how consent is obtained or documented.\nExamples: It would be culturally inappropriate in some international settings for a woman to be directly contacted by a male researcher; instead, the researcher may need to ask a male family member for permission before the woman can be approached. It may be appropriate to obtain permission from community leaders prior to obtaining consent from individual members of a group. In some distinct cultural groups, signing forms may not be the norm.\nThis federal site maintains an international list of human research standards and requirements: http://www.hhs.gov/ohrp/international/index.html\n\u0010\u0012\u001c\n\u00113.3. [DETERMINATION]   Location-specific laws. Describe any local laws that may affect the research (especially the research design and consent procedures). The most common examples are laws about:\nSpecimens – for example, some countries will not allow biospecimens to be taken out of the country.\nAge of consent – laws about when an individual is considered old enough to be able to provide consent vary across states, and countries.\n"},{"ty":"ae","et":"bookmark","id":"id.o2czomsj1egw","epm":{}},{"ty":"ae","et":"bookmark","id":"id.qk89pit4e933","epm":{}},{"ty":"ae","et":"bookmark","id":"id.qoxhyui2r2pk","epm":{}},{"ty":"ae","et":"bookmark","id":"id.v3vp3kwt5lkl","epm":{}},{"ty":"ae","et":"list","id":"kix.list.14","epm":{"le_nb":{"nl_4":{"b_gf":"%4","b_ts":{"ts_un":false,"ts_un_i":true,"ts_sc":false,"ts_it_i":true,"ts_fgc2":{"hclr_color":"#000000","clr_type":0},"ts_st_i":true,"ts_bgc2":{"hclr_color":null,"clr_type":0},"ts_fs_i":true,"ts_ff_i":false,"ts_bgc2_i":true,"ts_it":false,"ts_va":"nor","ts_bd_i":true,"ts_va_i":true,"ts_fs":11.0,"ts_ff":"Courier New","ts_st":false,"ts_bd":false,"ts_fgc2_i":true,"ts_sc_i":true,"ts_tw":400},"b_ifl":180.0,"b_gs":"o","b_a":0,"b_sn":1,"b_gt":9,"b_il":198.0},"nl_3":{"b_gf":"%3","b_ts":{"ts_un":false,"ts_un_i":true,"ts_sc":false,"ts_it_i":true,"ts_fgc2":{"hclr_color":"#000000","clr_type":0},"ts_st_i":t  their participation.\n\u0010\u0012\u001cUCSD has a health Data Oversight Committee (HDOC) that oversees data sharing with other institutions. For sharing research data with another academic (i.e., non-profit/non-commercial) institution, this is typically a straightforward process that is expedited. Approval is contingent upon IRB approval and will be sought immediately after IRB approval is obtained.\n\u00113.5. [DETERMINATION]  If the PI is a student: Does the research involve traveling outside of the U.S.?\n☐ No\n☐ Yes → Confirm by checking the box that (1) you will register with the UW Office of Global Affairs before traveling; (2) you will notify your advisor when the registration is complete; and (3) you will request a UW Travel Waiver is the research involves travel to the list of countries requiring a UW Travel Waiver. \n☐ Confirmed\n4. RECRUITING AND SCREENING PARTICIPANTS\n4.1. [DETERMINATION]  Recruiting and screening. Describe how subjects will be identified, recruited, and screened. Include information about: how, when, where, and in what setting. Identify who (by position or role, not name) will approach and recruit subjects, and who will screen them for eligibility.\nNote: Per UW Medicine policy, the UW Medicine eCare/MyChart system may not be used for research recruitment purposes. Additionally, researchers may not use UW Medicine’s Epic Care Everywhere data for research purposes unless the clinical data is necessary for patient/participant safety activities. This means Care Everywhere data cannot be used for recruitment, data abstraction, or any research activities other than those necessary for patient/participant safety.\n\u0010\u0012\u001cWe will first screen for eligible participants using medical records data search from each institution including ICD diagnosis codes, race, and age.\n\nInformation about the study may be provided to potential subjects as follows:\n\nMailed recruitment letters\nOver the 3+ years of study recruitment, approximately 50,000 invitation letters from each site will be sent by both mail and email to participants identified through the electronic medical record search as meeting study eligibility criteria. \n\nUW and UCSD will provide a list of potential participants (names, addresses, age, sex, race/ethnicity, phone number, email addresses, diabetes status) identified through the electronic medical record search to UAB. UAB will add information for their own eligible patients. Using the combined UW, UCSD, and UAB dataset, UAB will select a stratified sample of potential participants based on the sampling scheme. Sampling is necessary to ensure steady enrollment through the recruitment process and to not overwhelm the study staff by inviting all potential participants at one. Once a sample has been selected, a dataset of patient names, clinical information, and patient contact information will be uploaded to a secure site at UAB for Oregon Health and Science University (OHSU) to download to an OHSU server. Although the data will be housed in the UW REDCap system, OHSU is responsible for uploading the combined UW, UCSD, and UAB dataset into REDCap for the purpose of creating patient-specific REDCap survey links and the distribution of REDCap email invitations. After generating patient-specific REDCap survey links, the complete dataset (now including patient-specific REDCap survey links) will be sent back to UAB to send participant information to Adapt Inc., an SSAE16 SOC SecurityCertified and HIPAA-compliant printing and fulfillment service, to send out the recruitment letters. It is necessary for the letters to contain the patient-specific REDCap survey links. The aforementioned process will occur on a recursive basis with UAB coordinating the selection of participants to achieve balancing of race/ethnicity, sex, and diabetes severity until the recruitment goals have been achieved.\n\n*\n\nParticipants may also be E-mailed the recruitment letter.\n\nFollow-up phone calls will be made by research coordinators to those\nWho did not respond to emails and/or mailings\nWho initiated contact with the study teams.\nAI-READI Website\nParticipants will also be directed to the AI-READI website (https://aireadi.org, under construction) where they can learn more about the study, including the study FAQ.\n\nIf we are having recruitment difficulties, we may rely on the following options:\nRecords from specific clinics or satellite clinics affiliated with each institution\nReferrals from community centers\nReferrals from clinicians/clinic staff from each institution\nDatabases (e.g., Leaf), existing research studies and registries\nSelf-reports of diabetes status and diagnosis\n\nAs social media messages, flyers, and advertisements are not the primary methods of planned recruitment, the information for them have not yet been developed. If we need to rely on these sources, the materials will be submitted to IRB at a later date. However, the general information will be similar to the information in the vitiation letter sent by mail or email, study website (https://aireadi.org) and telephone talking points. \n\u0011"},{"ty":"ae","et":"inline","id":"i.1","epm":{"ee_eo":{"eo_bo":{"ln_s":0,"ln_w":0.0,"ln_c2":{"hclr_color":"#000000","clr_type":0}},"i_pid":null,"eo_mb":9.0,"i_ht":148.0,"eo_rtdf":{"rdf_ft":0},"eo_ml":9.0,"eo_mr":9.0,"eo_ad":null,"i_cid":"s-blob-v1-IMAGE-F5eDm1Ovx88","i_cont":0.0,"eo_mt":9.0,"eo_type":0,"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":"","lc_srk":""},"i_wth":510.0,"eo_at":null,"i_iwc":{"iwc_w":false},"eo_hb":false,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_iw":false,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"i_bri":0.0,"i_msct":0,"i_src":null,"i_opa":1.0}}},{"ty":"ae","et":"bookmark","id":"id.dsssi8qanlb","epm":{}},{"ty":"ae","et":"bookmark","id":"id.flqs228jcx4s","epm":{}},{"ty":"ae","et":"bookmark","id":"id.j1zo6ria4enb","epm":{}},{"ty":"ae","et":"bookmark","id": E637A">DOCS_modelChunk = [{"ty":"is","ibi":38556,"s":"4.2. Recruitment materials.\n4.2.a. What materials (if any) will be used to recruit and screen subjects?\nExamples: talking points for phone or in-person conversations; video or audio presentations; websites; social media messages; written materials such as letters, flyers for posting, brochures, or printed advertisements; questionnaires filled out by potential subjects.\n\u0010\u0012\u001cLetters sent out by email or emails\nFollow-up phone conversations\nFollow-up texts\nWebsites\n\nIf we are having recruitment difficulties, we may rely on any of the following options:\nSocial media messages\nFlyers\nAdvertisements\n\nThese materials, if needed, will be developed at a later date and submitted to the IRB.\n\u00114.2.b. Upload descriptions of each type of material (or the materials themselves) to Zipline. If letters or emails will be sent to any subjects, these should include a statement about how the subject’s name and contact information were obtained. No sensitive information about the person (such as a diagnosis of a medical condition) should be included in the letter. The text of these letters and emails must be uploaded to Zipline (i.e., a description will not suffice).\nHSD encourages researchers to consider uploading descriptions of most recruitment and screening materials instead of the materials themselves. The goal is to provide the researchers with the flexibility to change some information on the materials without submitting a Modification for IRB approval of the changes. Examples:\nProvide a list of talking points that will be used for phone or in-person conversations instead of a script.\nFor the description of a flyer, include the information that it will provide the study phone number and the name of a study contact person (without providing the actual phone number or name). This means that a Modification would not be necessary if/when the study phone number or contact person changes. Also, instead of listing the inclusion/exclusion criteria, the description below might state that the flyer will list one or a few of the major inclusion/exclusion criteria.\nFor the description of a video or a website, include a description of the possible visual elements and a list of the content (e.g., study phone number; study contact person; top three inclusion/exclusion criteria; payment of $\n50; study name; UW researcher).\n4.3. [DETERMINATION]  Relationship with participant population. Do any members of the study team have an existing relationship with the study population(s)?\nExample: a study team member may have a dual role with the study population such as being their clinical care provider, teacher, laboratory directory or tribal leader in addition to recruiting them for their research.\n☐ No\n☒ Yes → Describe the nature of the relationship.\n\u0010\u0012\u001cAs of now, our primary method of recruitment is based on electronic medical records search and contacting them via email, letter, and follow-up phone calls (please refer to 4.1). However, we may need to utilize other methods of recruitment listed in 4.1 if our recruitment rate is too low. In case we start relying on referrals from other clinics, registries, other community centers, and because we are trying to recruit a large number of participants, it is possible that the recruitment happens by word of mouth and we may recruit some participants who may be friends, colleagues, families, and relatives of our study staff. In addition, investigators who are also clinicians may have patients in their clinical practices who are eligible for participation.\n\u00114.4. Payment to participants. The IRB must evaluate subject payment for the possibility that it will unduly influence subjects to participate. Refer to GUIDANCE Subject Payment when designing subject payment plans. Provide the following information about your plans for paying research subjects in the text box below or note that the information can be found in the consent form. \nThe total amount/value of the payment\nSchedule/timing of the payment [i.e., when will subjects receive the payment(s)]\n"},{"ty":"ae","et":"bookmark","id":"id.59oxwo1jxzut","epm":{}},{"ty":"ae","et":"bookmark","id":"id.951c085b3fej","epm":{}},{"ty":"ae","et":"bookmark","id":"id.e8yc2m1nj4ph","epm":{}},{"ty":"ae","et":"bookmark","id":"id.gp7trfsuhymk","epm":{}},{"ty":"ae","et":"bookmark","id":"id.p68hfl12l93q","epm":{}},{"ty":"ae","et":"list","id":"kix.list.15","epm":{"le_nb":{"nl_4":{"b_gf":"%4","b_ts":{"ts_un":false,"ts_un_i":true,"ts_sc":false,"ts_it_i":true,"ts_fgc2":{"hclr_color":"#000000","clr_type":0},"ts_st_i":true,"ts_bgc2":{"hclr_color":null,"clr_type":0},"ts_fs_i":true,"ts_ff_i":false,"ts_bgc2_i":true,"ts_it":false,"ts_va":"nor","ts_bd_i":true,"ts_va_i":true,"ts_fs":11.0,"ts_ff":"Courier New","ts_st":false,"ts_bd":false,"ts_fgc2_i":true,"ts_sc_i":true,"ts_tw":400},"b_ifl":211.5,"b_gs":"o","b_a":0,"b_sn":1,"b_gt":9,"b_il":229.5},"nl_3":{"b_gf":"%3","b_ts":{"ts_un":false,"ts_un_i":true,"ts_sc":false,"ts_it_i":true,"ts_fgc2":{"hclr_color":"#000000","clr_type":0},"ts_st_i":true,"ts_bgc2":{"hclr_color":null,"clr_type":0},"ts_fs_i":true,"ts_ff_i":false,"ts_bgc2_i":true,"ts_it":false,"ts_va":"nor","ts_bd_i":true,"ts_va_i":true,"ts_fs":11.0,"ts_ff":"Noto Sans Symbols","ts_st":false,"ts_bd":false,"ts_fgc2_i":true,"ts_sc_i":true,"ts_tw":400},"b_ifl":175.5,"b_gs":"●","b_a":0,"b_sn":1,"b_gt":9,"b_il":193.5},"nl_2":{"b_gf":"%2","b_ts":{"ts_un":false,"ts_un_i":true,"ts_sc":false,"ts_it_i":true,"ts_fgc2":{"hclr_color":"#000000","clr_type":0},"ts_st_i":true,"ts_bgc2":{"hclr_color":null,"clr_type":0},"ts_fs_i":true,"ts_ff_i":false,"ts_bgc2_i":true,"ts_it":false,"ts_va":"nor","ts_bd_i":true,"ts_va_i":true,"ts_fs":11.0,"ts_ff":"Noto Sans Symbols","ts_st":false,"ts_bd":false,"ts_fgc2_i":true,"ts_sc_i":true,"ts_tw":400},"b_ifl":139.5,"b_gs":"▪","b_a":0,"b_sn":1,"b_gt":9,"b_il":157.5},"nl_1":{"b_gf":"%1","b_ts":{"ts_un":false,"ts_un_i":true,"ts_sc":fa e most frequent complaints received by HSD is from subjects who expected to receive cash or a check on the day that they completed a study and who were angry or disappointed when payment took 6-8 weeks to reach them. \nResearchers should review current UW Financial Management requirements about when Social Security Numbers must be collected, and when research payment must be reported to the UW Tax Office and the IRS: https://finance.uw.edu/ps/how-pay/research-subjects.\nIf your study involves the use of Amazon’s Mechanical Turk (MTurk), you must comply with the UW Procurement Services policy that no UW employee, family member, or student directly involved in the research will participate as a subject. The policy requires adding a qualifying question that asks whether the subject is a UW employee or family member, or UW student who is directly involved in the research. If they answer yes, they must be disqualified from MTurk activities.\n\u0010\u0012\u001cThere will be a $200 stipend for participation, which will be provided when we receive the final data from participants and return of the study devices. The timing of the payment will typically be at least 2 weeks after the study visit, taking into account 10 days of home-based data collection using the devices provided in the study and additional time for devices to be returned to the study team vial mail. The payment will not be prorated. The amount may be changed in future years depending on the study funding. We will notify IRB in case there is any change in the stipend amount.\n\nStudy will cover reasonable costs for parking, public transit, or rideshare fees (e.g., Uber or Lyft)  related to the study visit. \n\nThe same type and amount of compensation will be given to patients who are asked to come back in Year 4 of the study.\n\u001c\n\u00114.5. [DETERMINATION]  Non-monetary compensation. Describe any non-monetary compensation that will be provided. Example; extra credit for students; a toy for a child.\n\u00 getTime(); DOCS_initialLoadTiming.incrementTime('mp', DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script nonce="u-Ju_h25rM0x5G_-gE637A">DOCS_modelChunkParseStart = new Date().getTime();</script><script nonce="u-Ju_h25rM0x5G_-gE637A">DOCS_modelChunk = [{"ty":"is","ibi":46661,"s":"“Consent” includes: consent from individuals for their own participation; parental permission; assent from children; consent from a legally authorized representative for adult individuals who are unable to provide consent.\n\nExamples:\nFor a study in which names and contact information will be obtained from a registry: the registry should have consent from the registry participants to release their names and contact information to researchers.\nFor a study in which possible subjects are identified by screening records: there will be no consent process. \nFor a study in which individuals respond to an announcement and call into a study phone line: the study team person talking to the individual may obtain non-written consent to ask eligibility questions over the phone.\n☒ No → Skip the rest of this section; go to question 5.1.\n☐ Yes → Describe the consent process.\n\u0010\u0012\u001cClick or tap here to enter text.\n\u00114.7.a. Documentation of consent. Will a written or verifiable electronic signature from the subject on a consent form be used to document consent for the recruiting and screening procedures?\n☐ No → Describe the information that will be provided during the consent process and for which procedures.\n\u0010\u0012\u001cClick or tap here to enter text.\n\u0011☐ Yes, written → If yes, and a written signature will be used to document consent: \nUpload the consent form to Zipline.\n☐ Yes, electronic → If yes, and an electronic signature will be used to document consent:\nUpload the consent form to Zipline.\nIf the eSignature process or method for recruiting and screening is different than for the main study procedures, use the questions about electronic consent in Sections 8.3. and 8.4. to differentiate between recruiting/screening and main study electronic consent. If electronic consent will be used for recruiting/screening but not main study consent, use 8.3. and 8.4. to describe e-consent and note that it is only for recruiting/screening.\n5. PROCEDURES\n5.1. [DETERMINATION]  Study procedures. Using lay language, provide a complete description of the study procedures, including the sequence, intervention or manipulation (if any), drug dosing information (if any), blood volumes and frequency of draws (if any), use of records, time required, and setting/location. If it is available: Upload a study flow sheet or table to Zipline.\nFor studies comparing standards of care: It is important to accurately identify the research procedures. See UW IRB GUIDANCE Risks of Harm from Standard Care and the draft guidance from the federal Office of Human Research Protections, “Guidance on Disclosing Reasonably Foreseeable Risks in Research Evaluating Standards of Care”; October 20, 2014.\nInformation about pediatric blood volume and frequency of draws that would qualify for expedited review can be found in this reference table on the Seattle Children’s IRB website.\n\u0010\u0012\u001cThe study visit will take approximately 3-4 hours. If requested by subjects, the visit can be performed over a couple of days instead of a single visit.\n\nSample and Data Collection: \nFollowing consent, we will collect demographic information, basic measurements (weight and height), and vitals. At the earliest possible time, we will collect blood and urine for testing. We will collect approximately 50-60 ml of blood (about 3-4 spoonfuls). In the event that the original blood and/or urine sample quantities were insufficient for the planned testing, we may bring the participant(s) back for an additional blood draw and/or urine sample collection. The list of tests based on blood and urine samples is in the section 5.4.\n\nParticipants will not need to be fasting. We will ask the participant about their last per oral food or drink intake at the time of the study visit. A small snack and drink will be available for participants at any time during the study or after the visit. \n\nQuestionnaires:\nParticipants will fill out the following questionnaires:\nCenter for Epidemiological Studies – Depression (CES-D-10) survey\nCES-10 survey\nDiabetes self-care activities measurements (SDSCA)\nDiet questionnaire\nMedication Log\nGeneral Health Survey\nProblem Areas In Diabetes questionnaire (PAID-5)\nSocial Determinants of Health questionnaires (PhenX selection of surveys)\nVisual Impairment and Access to Eye Care Questionnaires\nAlcohol, Smoking, Marijuana and Vaping Use and History Questionnaire (UW and UCSD sites) OR Alcohol, Smoking and Vaping use and History Questionnaire (UAB site only)\n\nTo reduce the visit time, questionnaires may be filled out electronically or on paper before or after the in-person visit. Paper-based questionnaires may be brought to the study visit or mailed back with the devices.\n\nTesting:\nMemory and cognitive function will be assess with the MoCA cognitive test (Montreal Cognitive Assessment). We will obtain a 12-lead ECG and perform the monofilament test (https://www.ncbi.nlm.nih.gov/pmc/articles/PMC2775618/).\n\nVision Exam and Retinal Imaging:\nVisual function testing will be performed as follows:\nAuto-refraction\nBest-corrected visual acuity\nBest-corrected low luminance visual activity\nContrast sensitivity\nLow luminance contrast sensitivity\n\nTo perform eye imaging, participants will receive on or two types of eye drops (see Drugs) for pupil dilation. Participants may receive numbing drops (see Drugs) if needed.\n\nOptical coherence tomography (OCT), fundus photography, fluorescence lifetime imaging ophthalmoscopy (FLIO), and optical coherence tomography angiography (OCTA) will be collected using multiple devices. All imaging will be performed using non-invasive imaging methods.\n\nWearable and at-home devices:\nStudy participants will have a continuous glucose monitoring device (CGM) applied to their abdomen and will be given a fitness tracking device for activity monitoring. We will use Dexcom CGM devices that collect glucose data over a 10-day period. Participants who are currently wearing a Dexcom G6 will have two options. The first option is to place an additional study Dexcom G6 sensor at least 3 inches away from their current sensor and injection site, wear it for 10 days and send back the transmitter to study staff to download data. The second option does not place an additional study sensor and instead uses the participant’s current Dexcom G6 device to get data through Clarity. The study will invite the participant with a unique code to share their Dexcom Clarity data with the study clinic. At the end of the 10 days, study staff will log into Dexcom Clarity and download the participant’s data. Patients who already wear Dexcom G6 sensor at the time of the visit will be given an option to allow download of the previously collected glucose values for up to 90 days prior to the study visit. After we capture the 10 days of data, up to 100 days total of glucose data will be collected through the application for subjects who agree to the additional data download, and the study clinic will terminate data sharing with the participant. Sharing with the study clinic will not disrupt their current sharing with any other clinic. \n\n\nStudy participants will receive a small sensor (for environmental data monitoring) and place it at home for data collection for 10 days, and will be asked to return it with the CGM device by mail in a box provided by the study team. The participants will be sent home with instruction for the removal of the CGM device and return the devices back to the research site. \n\nAt-home Participation:\nThe participants will wear the CGM and fitness tracker for 10 days. The participants will also place the environmental sensor in their homes for 10 days. At the end of the 10-day period, participants will need to mail all three devices back so we can obtain the data. Subjects will receive a reminder to return the CGM, fitness tracker, and environmental sensor via phone, text, or email, per their stated preference.\nAccessing Medical Records:\nWe will be extracting medical records to obtain data on general health, eye health, medical and surgical history, diabetes, medications, laboratory records, and any previous medical imaging such as eye imaging. We will also collect information about any car accidents they may have experienced and traffic tickets the participant has received in the last 3 years.\n\nParticipants will be asked to complete an exit survey.\n\nFuture Participation:\nSome study participants who were recruited during Year 1 and 2 (we intend to invite 10% of the study population) will be asked to come for additional follow up visit in Year 4. The follow-up visit would be similar to the visit described above, such as requesting wearing of CGM, fitness tracking device, and environmental sensor. No new variables will be added for collection but not all variables will be collected due to budget constraints.\n\u0011"},{"ty":"ae","et":"bookmark","id":"id.wynft9tc5thi","epm":{}},{"ty":"ae","et":"bookmark","id":"id.xi4x4h24w88m","epm":{}},{"ty":"ae","et":"bookmark","id":"id.yf59os22lzs9","epm":{}},{"ty":"ae","et":"list","id":"kix.list.17","epm":{"le_nb":{"nl_4":{"b_gf":"%4","b_ts":{"ts_un":false,"ts_un_i":true,"ts_sc":false,"ts_it_i":true,"ts_fgc2":{"hclr_color":"#000000","clr_type":0},"ts_st_i":true,"ts_bgc2":{"hclr_color":null,"clr_type":0},"ts_fs_i":true,"ts_ff_i":false,"ts_bgc2_i":true,"ts_it":false,"ts_va":"nor","ts_bd_i":true,"ts_va_i":true,"ts_fs":11.0,"ts_ff":"Courier New","ts_st":false,"ts_bd":false,"ts_fgc2_i":true,"ts_sc_i":true,"ts_tw":400},"b_ifl":180.0,"b_gs":"o","b_a":0,"b_sn":1,"b_g onal.\n\u00115.6. [DETERMINATION]  Identifiability of data and specimens. Answer these questions carefully and completely. This will allow HSD to accurately determine the type of review that is required and the relevant compliance requirements. Review the following definitions before answering the questions:\nAccess means to view or perceive data, but not to possess or record it. See, in contrast, the definition of “obtain”.\nIdentifiable means that the identity of an individual is or may be readily (1) ascertained by the researcher or any other member of the study team from specific data variables or from a combination of data variables, or (2) associated with the information. \nDirect identifiers are direct links between a subject and data/specimens. Examples include (but are not limited to): name, date of birth, medical record number, email or IP address, pathology or surgery accession number, student number, or a collection of data that is (when taken together) identifiable. \nIndirect identifiers are information that links between direct identifiers and data/specimens. Examples: a subject code or pseudonym.\nKey refers to a single place where direct identifiers and indirect identifiers are linked together so that, for example, coded data can be identified as relating to a specific person. Example: a master list that contains the data code and the identifiers linked to the codes.\nObtain means to possess or record in any fashion (writing, electronic document, video, email, voice recording, etc.) for research purposes and to retain for any length of time. This is different from accessing, which means to view or perceive data.\n5.6.a. Will you or any members of you team have access to any direct or indirect identifiers?\n☒ Yes → Describe which identifiers and for which data/specimens.\n\u0010\u0012\u001cName, MRN, DOB, age, sex, race/ethnicity, address, phone number, driver’s license number, and email\n\u0011☐ No → Select the reason(s) why you (and all members of  the PHI is accessed, obtained and/or used?\n\u0010\u0012\u001cAll PHI accessed or collected following enrollment.\n\u0011Confirm by checking the box that UW Medicine HIPAA Authorization form maintained on the HSD website will be used to access obtain, use, or disclose any UW Medicine PHI.\n☒ Confirmed\n5.7.e. Will you obtain any HIPAA authorizations electronically (i.e., e-signature)?\n☐ No\n☒ Yes → Confirm by checking the box that you have read and understand the Electronic Documentation of Consent section of the WORKSHEET Consent Requirements and Waivers the GUIDANCE Consent Documentation of Consent for information regarding the use of electronic signatures and HIPAA authorizations.\n☒ Confirmed\n5.7.f. For which PHI will HIPAA authorization NOT be obtained from the subjects?\n\u0010\u0012\u001cPHI obtained for the prescreening activities\n\u0011Provide the following assurances by checking the boxes.\n☒ The minimum necessary amount of PHI to accomplish the purposes described in this application will be accessed, obtained and/or used.\n☒ The PHI will not be reused or disclosed to any other person or entity, except as required by law, for authorized oversight of the research study, or for other research for which the use or disclosure of PHI would be permitted.\n☒ The HIPAA “accounting for disclosures” requirement will be fulfilled, if applicable. See UW Medicine Compliance Policy #104.\n☒ There will be reasonable safeguards to protect against identifying, directly or indirectly, any patient in any report of the research.\n5.8. [DETERMINATION]  Genomic data sharing. Will the research obtain or generate genomic data?\n☐ No\n☒ Yes → Answer the question below.\n5.8.a. Will genomic data from this research be sent to a national database (for example, NIH’s dbGaP database)?\n☐ No\n☒ Yes → Complete the SUPPLEMENT Genomic Data Sharing and upload it to Zipline.\n5.9. Whole genome sequencing. For research involving biospecimens: Will the research include whole genome sequencing?\nWhole genome sequencing is sequencing of a human germline or somatic specimen with the intent to generate the genome or exome sequence of that specimen.\n☐ No\n☒ Yes\n5.10. [DETERMINATION]  Cannabis (marijuana), hemp, and related compounds. These questions are about: cannabis (any part of the plant in any form), hemp, cannabidiol (CBD), delta-8-THC, any product derived from cannabis or hemp, and related synthesized compounds. All UW research must comply with federal laws about cannabis because of conditions associated with the federal money that UW receives. Answer the questions below so that HSD can determine whether the federal laws apply to your specific situation. See the UW Guidance on Research Involving Marijuana for additional information.\n"},{"ty":"ae","et":"bookmark","id":"id.47dul1g9zdts","epm":{}},{"ty":"ae","et":"bookmark","id":"id.lpxchnweo9w6","epm":{}},{"ty":"ae","et":"bookmark","id":"id.m94n0omfciso","epm":{}},{"ty":"ae","et":"bookmark","id":"id.n1ix0vckjcs9","epm":{}},{"ty":"ae","et":"bookmark","id":"id.opuan4g34cl5","epm":{}},{"ty":"ae","et":"bookmark","id":"id.si9fgaogclc1","epm":{}},{"ty":"ae","et":"bookmark","id":"id.ugh1pifpr9nd","epm":{}},{"ty":"ae","et":"bookmark","id":"id.xjjoywudrkey","epm":{}},{"ty":"ae","et":"bookmark","id":"id.yre6qs6pz8cr","epm":{}},{"ty":"ae","et":"bookmark","id":"id.zfki0dc89ede","epm":{}},{"ty":"te","id":"id.47dul1g9zdts","spi":69683},{"ty":"te","id":"id.lpxchnweo9w6","spi":69618},{"ty":"te","id":"id.m94n0omfciso","spi":72081},{"ty":"te","id":"id.n1ix0vckjcs9","spi":71750},{"ty":"te","id":"id.opuan4g34cl5","spi":70186},{"ty":"te","id":"id.si9fgaogclc1","spi":72363},{"ty":"te","id":"id.ugh1pifpr9nd","spi":69112},{"ty":"te","id":"id.xjjoywudrkey","spi":70936},{"ty":"te","id":"id.yre6qs6pz8cr","spi":71885},{"ty":"te","id":"id.zfki0dc89ede","spi":70536},{"ty":"as","st":"paragraph","si":68986,"ei":68986,"sm":{"ps_lslm":1,"ps_awao_i":false,"ps_ls":1.0,"ps_sm_i":false,"ps_ls_i":false,"ps_sa":12.0,"ps_il_i":false,"ps_  and whether it contains ≥0.3% THC (tetrahydrocannabinol).\n\u0010\u0012\u001cClick or tap here to enter text.\n\u00115.11. Possible secondary use or sharing of information, specimens, or subject contact information. Is it likely that the obtained or collected information, specimens, or subject contact information will be used for any of the following:\nFuture research not described in this application (in other words, secondary research)\nSubmission to a repository, registry, or database managed by the study team, colleagues, or others for research purposes\nSharing with others for their own research\nPlease consider the broadest possible future plans and whether consent will be obtained now from the subjects for future sharing or research uses (which it may not be possible to describe in detail at this time). Answer YES even if future sharing or uses will use de-identified information or specimens. Answer NO if sharing is unlikely or if the only sharing will be through the NIH Genomic Data Sharing described in question 5.8.\nMany federal grants and contracts now require data or specimen sharing as a condition of funding, and many journals require data sharing as a condition of publication. “Sharing” may include (for example): informal arrangements to share banked data/specimens with other investigators; establishing a repository that will formally share with other researchers through written agreements; or sending data/specimens to a third-party repository/archive/entity such as the Social Science Open Access Repository (SSOAR), or the UCLA Ethnomusicology Archive.\n☐ No\n☒ Yes → Answer all of the questions below. (Questions 5.11.a through 5.11.g)\n5.11.a. Describe what will be stored for future use, including whether any direct or indirect (e.g., subject codes) identifiers will be stored.\n\u0010\u0012\u001cSubject codes, contact information/identifiers, deidentified data, unused specimen\n\u00115.11.b. Describe what will be shared with other researchers or with ring participation in longitudinal research.\nWhen children are enrolled at a young age and continue for many years, it is best practice to re-obtain assent (or to obtain it for the first time, if it was not obtained at the beginning of their participation). \nWhen children reach the legal age of consent, informed consent must be obtained from the now-adult subject for (1) any ongoing interactions or interventions with the subjects, or (2) the continued analysis of specimens or data for which the subject’s identify is readily identifiable to the researcher, unless the IRB waives this requirement.\n7.6.a. Describe the plans (if any) to re-obtain assent from children.\n\u0010\u0012\u001cClick or tap here to enter text.\n\u0011\n7.6.b. Describe the plans (if any) to obtain consent for children who reach the legal age of consent. \nIf adult consent will be obtained from them, describe what will happen regarding now-adult subjects who cannot be contacted.\nIf consent will not be obtained or will not be possible, explain why.\n\u0010\u0012\u001cClick or tap here to enter text.\n\u00117.7. Other regulatory requirements. (This is for information only; no answer or response is required.) Researchers are responsible for determining whether their research conducted in schools, with student records, or over the Internet comply with permission, consent, and inspection requirements of the following federal regulations:\nPPRA – Protection of Pupil Rights Amendment\nFERPA – Family Education Rights and Privacy Act\nCOPPA – Children’s Online Privacy Protection Act\n8 CONSENT OF ADULTS\n\u0010\u0012\u001cWhen designing consent process and forms, researchers should first review the GUIDANCE Consent and TIPSHEET Consent. The topics of A Foundation for Meaningful Consent and The Key Information Requirement are particularly important for ensuring subject comprehension and voluntary participation in research. Information about parental permission can be found in the GUIDANCE Consent Protected and Vulnerable Populations.\n\u0011Review the following definitions before answering the questions in this section.\n\u0010\u0012\u001cTERM\n\u001cDEFINITION\n\u0012\u001cCONSENT\n\u001cis the process of informing potential subjects about the research and asking them whether they want to participate. It does not necessarily include the signing of a consent form.\n\u0012\u001cCONSENT DOCUMENTATION\n\u001crefers to how a subject’s decision to participate in the research is documented. This is typically obtained by having the subject sign a consent form.\n\u0012\u001cCONSENT FORM\n\u001cis a document signed by subjects, by which they agree to participate in the research as described in the consent form and in the consent process.\n\u0012\u001cELEMENTS OF CONSENT\n\u001care specific information that is required to be provided to subjects.\n\u0012\u001cCHARACTERISTICS OF CONSENT\n\u001care the qualities of the consent process as a whole. These are: \nConsent must be legally effective.\nThe process minimizes the possibility of coercion or undue influence.\nSubjects or their representatives must be given sufficient opportunity to discuss and consider participation.\nThe information provided must:\nBegin with presentation of key information (for consent materials over 2,000 words).\nBe what a reasonable person would want to have.\nBe organized and presented so as to facilitate understanding.\nBe provided in sufficient detail.\nNot ask or appear to ask subjects to waive their rights.\n\u0012\u001cPARENTAL PERMISSION\n\u001cis the parent’s active permission for the child to participate in the research. Parental permission is subject to the same requirements as consent, including written documentation of permission and required elements.\n\u0012\u001cSHORT FORM CONSENT\n\u001cis an alternative way of obtaining written documentation of consent that is most commonly used for the unanticipated enrollment of individuals who are illiterate or whose language is one for which translated consent forms are not available.\n\u0012\u001cWAIVER OF CONSENT\n\u001cmeans there is IRB approval for not obtaining consent or for not including some of the elements of consent in the consent process.\nNOTE: if you plan to obtain identifiable information or identifiable biospecimens without consent, any waiver granted by the IRB does not override a subject’s refusal to provide broad consent (for example, the Northwest Biotrust).\n\u0012\u001cWAIVER OF DOCUMENTATION OF CONSENT\n\u001cmeans that there is IRB approval for not obtaining written documentation of consent.\n\u0011"},{"ty":"ae","et":"bookmark","id":"id.hcqa4prye9w6","epm":{}},{"ty":"ae","et":"bookmark","id":"id.jaz1dfd668c6","epm":{}},{"ty":"ae","et":"bookmark","id":"id.lu64x2yarsps","epm":{}},{"ty":"ae","et":"bookmark","id":"id.p5iq1tq02im3","epm":{}},{"ty":"ae","et":"bookmark","id":"id.ugfr93vuekba","epm":{}},{"ty":"ae","et":"bookmark","id":"id.usi9t5lhpnhd","epm":{}},{"ty":"ae","et":"list","id":"kix.list.2","epm":{"le_nb":{"nl_4":{"b_gf":"%4","b_ts":{"ts_un":false,"ts_un_i":true,"ts_sc":false,"ts_it_i":true,"ts_fgc2":{"hclr_color":"#000000","clr_type":0},"ts_st_i":true,"ts_bgc2":{"hclr_color":null,"clr_type":0},"ts_fs_i":true,"ts_ff_i":false,"ts_bgc2_i":true,"ts_it":false,"ts_va":"nor","ts_bd_i":true,"ts_va_i":true,"ts_fs":11.0,"ts_ff":"Courier New","ts_st":false,"ts_bd":false,"ts_fgc2_i":true,"ts_sc_i":true,"ts_tw":400},"b_ifl":162.0,"b_gs":"o","b_a":0,"b_sn":1,"b_gt":9,"b_il":180.0},"nl_3":{"b_gf":"%3","b_ts":{"ts_un":false,"ts_un_i":true,"ts_sc":false,"ts_it_i":true,"ts_fgc2":{"hclr_color":"#000000","clr_type":0},"ts_st_i":true,"ts_bgc2":{"hclr_color":null,"clr_type":0},"ts_fs_i":true,"ts_ff_i":false,"ts_bgc2_i":true,"ts_it":false,"ts_va":"nor","ts_bd_i":true,"ts_va_i":true,"ts_fs":11.0,"ts_ff":"Noto Sans Symbols","ts_st":false,"ts_bd":false,"ts_fgc2_i":true,"ts_sc_i":true,"ts_tw":400},"b_ifl":126.0,"b_gs":"●","b_a":0,"b_sn":1,"b_gt":9,"b_il":144.0},"nl_2":{"b_gf":"%2","b_ts":{"ts_un":false," jects will have two days to decide after hearing about the study.\n\u0010\u0012\u001cOur first line of recruitment is through medical records database search, so it is unlikely that we will have any previous relationship with participants. However, it is possible that we will have to rely on other forms of recruitment, such as referral based. Then, if the referral to the study comes from a research staff member who a has relationship with the potential participant, the actual recruitment and consenting process will be performed by a research staff member that does NOT have any pre-existing relationship with the participant. \n\u00118.2.e. Information provided is tailored to the needs of the subject population. Describe the basis for concluding that the information that will be provided to subjects (via written or oral methods) is what a reasonable member of the subject population(s) would want to know. If the research consent materials contain a key information section, also describe the basis for concluding that the information present in that section is that which is most likely to assist the selected subject population with making a decision. See GUIDANCE Consent Key Information and EXAMPLE Key Information.\nFor example: Consultation with publications about research subjects’ preferences, disease-focused nonprofit groups, patient interest groups, or other researchers/study staff with experience with the specific population. It may also involve directly consulting selected members of the study population.\n\u0010\u0012\u001cWe have years of experience preparing consent forms for study subjects. There will also be a community advisory board that evaluates the consent forms and research protocols and their feedback will be considered in the modifications of the IRB as needed\n\u00118.2.f. Ongoing process, new information, and reconsent. \nFor research that involves multiple or continued interaction with subjects over time, describe the opportunities (if any) that wi tronic consent requirements at UW.\n☐ No → Skip to question 8.4.\n☒ Yes → Answer questions 8.3.a. through 8.3.e.\n8.3.a. Describe the electronic consent methodology and the information that will be provided.\nAll information materials must be made available to the IRB. Website content should be provided as a Word document. It is considered best practice to give subjects information about multi-page/multi-screen information that will help them assess how long it will take them to complete the process. For example, telling them that it will take about 15 minutes, or that it involves reading six screens or pages.\n\u0010\u0012\u001cPotential participants will receive an email with a unique code to access their e-consent, supported by UW REDCap.\n\u00118.3.b. Describe how the information can be navigated (if relevant). \nFor example, will the subject be able to proceed forward or backward within the system, or to stop and continue at a later time?\n\u0010\u0012\u001cWeb access will provide free navigation, forward and backward, within the system, as well as the ability to come back at a later time. Individuals will have the ability to exit out of the consent document and request more information from the study team.\n\u00118.3.c. In a standard paper-based consent process, the subjects generally have the opportunity to go through the consent form with study staff and/or to ask study staff about any question they may have after reading the consent form. Describe what will be done, if anything, to facilitate the subject’s comprehension and opportunity to ask questions when consent information is presented electronically. Include a description of any provisions to help ensure privacy and confidentiality during this process.\nExamples: hyperlinks, help text, telephone calls, text messages or other type of electronic messaging, video conference, live chat with remotely located study team members.\n\u0010\u0012\u001cContact information for the study staff will be given in the recruitment materials, as well as the electronic consent form itself. Potential participants are encouraged to call, email, or set up a Zoom meeting with the study staff. The study website may also have a live chat function.\n\u00118.3.d. What will happen if there are individuals who wish to participate but who do not have access to the consent methodology being used, or who do not wish to use it? Are there alternative ways in which they can obtain the information, or will there be some assistance available? If this is a clinical trial, these individuals cannot be excluded from the research unless there is a compelling rationale.\nFor example, consider individuals who lack familiarity with electronic systems, have poor eyesight or impaired motor skills, or who do not have easy email or internet access.\n\u0010\u0012\u001cE-consent is just an additional modality to the standard paper-based consent; subjects can choose which is easier and more accessible to them.\n\u00118.3.e. How will the research team ensure continued accessibility of consent materials and information during the study?\n\u0010\u0012\u001cUpon signing, the signed consent form will be automatically emailed to subjects. Subjects will be able to receive an additional copy of their signed e-consent by contacting study coordinator(s) at any time during the study.\n\u00118.3.f. How will additional information be provided to subjects during the research, including any significant new findings (such as new risk information). If this is not an issue, explain why.\n\u0010\u0012\u001cStudy participants will have access to some of their clinical laboratory data via an online portal. This is not an interventional study, so significant new findings are not expected. Subjects will receive a card with the study visit information (e.g., vital signs, visual acuity), as described.\n\u0011"},{"ty":"ae","et":"bookmark","id":"id.1gavk1wle0x8","epm":{}},{"ty":"ae","et":"bookmark","id":"id.8zjntzsqrcl4","epm":{}},{"ty":"ae"  copy of the consent information (consent form) to individuals who provide an e-signature?\nThe copy can be paper or electronic and may be provided on an electronic storage device or via email. If the electronic consent information uses hyperlinks or other websites or podcasts to convey information specifically related to the research, the information in these hyperlinks should be included in the copy provided to the subjects and the website must be maintained for the duration of the entire study.\n\u0010\u0012\u001cClick or tap here to enter text.\n\u00118.4.c. Barriers to written documentation of consent. There are many possible barriers to obtaining written documentation of consent. Consider, for example, individuals who are functionally illiterate; do not read English well; or have sensory or motor impairments that may impede the ability to read and sign a consent form.\n8.4.c.1. Describe the plans (if any) for obtaining written documentation of consent from potential subjects who may have difficulty with the standard documentation process (that is, reading and signing a consent form).\nExamples of solutions: Translated consent forms; use of the Short Form consent process; reading the form to the person before they sign it; excluding individuals who cannot read and understand the consent form.\n\u0010\u0012\u001cFor subjects who have difficulty viewing the study consent, a study team member will read the consent form for them. We still expect that a subject would be capable of signing the consent form. If a person is functionally illiterate, a study team member will sign and note the reason for missing subject signature in the presence of an impartial witness.\n\u00118.5. Non-English-speaking or-reading adult subjects. Will the research enroll adult subjects who do not speak English or who lack fluency or literacy in English?\n☐ No\n☒ Yes → Describe the process that will be used to ensure that the oral and written information provided to them during the consent process and throughout the study will be in a language readily understandable to them and (for written materials such as consent forms or questionnaires) at an appropriate reading/comprehension level.\n\u0010\u0012\u001cBased on the feedback from the community advisory group, the study team realized that to truly enroll non-English speaking participants, it would be necessary to translate all materials (not just the consent form), which is currently not possible. Therefore, non-English speaking participants will not be initially enrolled and all patients will need to be proficient enough to understand instructions of the study procedures such as using fitness tracking and CGM.\n\n¼ of our target study population is Hispanic/LatinX. We will first rely on recruiting Hispanic patients who can consent and fully communicate in English. If our recruitment goal is not being met, then the consent form will be translated into Spanish to be able to recruit patients who prefer to be consented in Spanish. We have native Spanish speaking research staff at UCSD who can translate the instructions, but we do not have research staff who speak other languages. \n\u00118.5.a. Interpretation. Describe how interpretation will be provided, and when. Also, describe the qualifications of the interpreter(s) - for example, background, experience, language proficiency in English and in the other language, certification, other credentials, familiarity with the research related vocabulary in English and the target language.\n\u0010\u0012\u001cNative Spanish speaking research staff will provide interpretation and instructions as needed.\n\u00118.5.b. Translations. Describe how translations will be obtained for all study materials (not just consent forms). Also, describe the method for ensuring that the translations meet the UW IRB’s requirement that translated documents will be linguistically accurate, at an appropriate reading level for the participant population, and culturally sensitive for the local in which they will be used.\n"},{"ty":"ae","et":"bookmark","id":"id.21b7smbmozbs","epm":{}},{"ty":"ae","et":"bookmark","id":"id.2ejlmy2agv49","epm":{}},{"ty":"ae","et":"bookmark","id":"id.a63lpfrdves3","epm":{}},{"ty":"ae","et":"bookmark","id":"id.jb7rqrwlauxs","epm":{}},{"ty":"ae","et":"bookmark","id":"id.n7i0hywr0prd","epm":{}},{"ty":"ae","et":"bookmark","id":"id.p2ikl9u3j7fe","epm":{}},{"ty":"te","id":"id.21b7smbmozbs","spi":115507},{"ty":"te","id":"id.2ejlmy2agv49","spi":118515},{"ty":"te","id":"id.a63lpfrdves3","spi":114915},{"ty":"te","id":"id.jb7rqrwlauxs","spi":115832},{"ty":"te","id":"id.n7i0hywr0prd","spi":118064},{"ty":"te","id":"id.p2ikl9u3j7fe","spi":118064},{"ty":"as","st":"tbl","si":114712,"ei":114712,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":277.5,"col_wt":0,"col_tdt":{"tdt_v":0},"col_tf":{"ttf_vn":0,"ttf_n":""}}]}},"tbls_cfwt":{"cfmt_cg":{"cellgp_pt":0.0,"cellgp_bt_i":false,"cellgp_pl_i":false,"cellgp_va":2,"cellgp_bl":{"brdr_c2":{"hclr_color":"#000000","clr_type":0},"brdr_s":0.0,"brdr_w":0.5,"brdr_ls":0},"cellgp_biv_i":false,"cellgp_pb_i":false,"cellgp_pl":5.4,"cellgp_bb":{"brdr_c2":{"hclr_color":"#000000","clr_type":0},"brdr_s":0.0,"brdr_w":0.5,"brdr_ls":0},"cellgp_bih":{"brdr_c2":{"hclr_color":"#000000","clr_type":0},"brdr_s":0.0,"brdr_w":0.5,"brdr_ls":0},"cellgp_bb_i":false,"cellgp_pr":5.4,"cellgp_va_i":true,"cellgp_pr_i":false,"cellgp_bgc2":{"hclr_color":"","clr_type":0},"cellgp_bih_i":false,"cellgp_bl_i":false,"cellgp_pt_i":false,"cellgp_bgc2_i":true,"cellgp_biv":{"brdr_c2":{"hclr_color":"#000000","clr_type":0},"brdr_s":0.0,"brdr_w":0.5,"brdr_ls":0},"cellgp_br_i":false,"cellgp_br":{"brdr_c2":{"hclr_color":"#000000","clr_type":0},"brdr_s":0.0,"brdr_w":0.5,"brdr_ls":0},"cellgp_bt":{"brdr_c2":{"hclr_color":"#000000","clr_type":0},"brdr_s":0.0,"brdr_w":0.5,"brdr_ls":0},"cellgp_pb":0.0},"cfmt_ps":{"ps_awao_i":true,"ps_klt_i":true,"ps_ir":0.0,"ps_ls_i":false,"ps_al_i":true,"ps_ltr":true,"ps_rd":"","ps_bl_i":true,"ps_sd_i":tru .\n\u0010\u0012\u001cClick or tap here to enter text.\n\u00118.7. [DETERMINATION] Cognitively impaired adults, and other adults unable to consent. Will such individuals be included in the research?\nExamples: individuals with Traumatic Brain Injury (TBI) or dementia; individuals who are unconscious, or who are significantly intoxicated.\n☒ No → Go to question 8.8.\n☐ Yes → Answer the following question.\n8.7.a. Rationale. Provide the rationale for including this population.\n\u0010\u0012\u001cClick or tap here to enter text.\n\u00118.7.b. Capacity for consent/decision making capacity. Describe the process that will be used to determine whether a cognitively impaired individual is capable of consent decision making with respect to the research protocol and setting.\n\u0010\u0012\u001cClick or tap here to enter text.\n\u00118.7.b.1. If there will be repeated interactions with the impaired subjects over a time period when cognitive capacity could increase of diminish, also describe how (if at all) decision-making capacity will be re-assessed and (if appropriate) consent obtained during that time.\n\u0010\u0012\u001cClick or tap here to enter text.\n\u00118.7.c. Permission (surrogate consent). If the research will include adults who cannot consent for themselves, describe the process for obtaining permission (“surrogate-consent”) from a legally authorized representative (LAR).\nFor research conducted in Washington State, see GUIDANCE Consent Diminished and Fluctuating Consent Capacity and Use of a Legally Authorized Representative (LAR) to learn which individuals meet the state definition of “legally authorized representative”.\n\u0010\u0012\u001cClick or tap here to enter text.\n\u00118.7.d. Assent. Describe whether assent will be required of all, some, or none of the subjects. If some, indicate which subjects will be required to assent and which will not (and why not). Describe any process that will be used to obtain and document assent from the subjects.\n\u0010\u001  eye shades to protect their eyes from excessive sensitivity to light. Rarely, patients may experience prolonged dilation lasting 1-2 days. There are very rare, but serious adverse events associated with dilation drops, including angle closure attacks, allergic reactions, increased blood pressure, and arrhythmias. In the event that a participant experiences any of these rare events, emergency medical attention would be sought immediately.\n\nEye imaging – low risk - imaging can occasionally take a long time, or the light source used during imaging may cause slight discomfort or a headache\n\nCOVID-19 exposure – due to the current pandemic, patients may be exposed to COVID-19. We have in place an in-person research plan, per HSD guidelines, and will complete the HSD COVID-19 risk assessment tool before and during the study to ensure subjects’ safety.\n\nEmotional stress – low risk – could be caused by any conditions that may be revealed by study participation.\n\nFatigue – low risk – subjects may be fatigued from the study visit, which may last several hours. We will readily accommodate any subject’s request for a break.\n\nBlood draw – low risk – may cause bruising, fainting, pain, or infection. We will provide a small snack following blood collection to reduce a chance of fainting or weakness. Extremely rarely the puncture site may become infected, which could lead to hospitalization or death.\n\nCGM – low risk – may cause bruising, pain, or infection at the point of insertion; irritation due to prolonged presence of the monitor/adhesive on the skin (e.g., due to excessive sweating or tight clothing), or skin discoloration. If the CGM is uncomfortable, we will let the patients remove it and mail it back before the full 10 days have elapsed. \n\nFitness tracking – low risk – there is no known harm to wearing a fitness tracking device. The subjects will be educated by staff on sizing the devices to minimize the discomfort caused by ill-fitted wristbands.\n\nEnvironmental sensor – low risk – there is no known risk to having an environment sensor in the home.\n\u001110.2. [DETERMINATION]  Reproductive risks. Are there any risks of the study procedures to subjects or partner of subjects related to pregnancy, fertility, lactation or effects on a fetus or neonate?\nExamples: direct teratogenic effects; possible germline effects; effects on fertility; effects on a woman’s ability to continue a pregnancy; effects on future pregnancies.\n☒ No → Go to question 10.3.\n☐ Yes → Answer the following questions:\n10.2.a. Risks. Describe the magnitude, probability, duration and/or reversibility of the risks.\n\u0010\u0012\u001cClick or tap here to enter text.\n\u0011"},{"ty":"ae","et":"bookmark","id":"id.f2rm69ofsob2","epm":{}},{"ty":"ae","et":"bookmark","id":"id.ikvnxkauf7yp","epm":{}},{"ty":"te","id":"id.f2rm69ofsob2","spi":134688},{"ty":"te","id":"id.ikvnxkauf7yp","spi":135127},{"ty":"as","st":"list","si":131321,"ei":131321,"sm":{"ls_ts":{"ts_un":false,"ts_un_i":false,"ts_sc":false,"ts_it_i":false,"ts_fgc2":{"hclr_color":"#595959","clr_type":0},"ts_st_i":false,"ts_bgc2":{"hclr_color":null,"clr_type":0},"ts_fs_i":false,"ts_ff_i":false,"ts_bgc2_i":false,"ts_it":true,"ts_va":"nor","ts_bd_i":false,"ts_va_i":false,"ts_fs":10.0,"ts_ff":"Calibri","ts_st":false,"ts_bd":false,"ts_fgc2_i":false,"ts_sc_i":false,"ts_tw":400},"ls_id":"kix.list.32"}},{"ty":"as","st":"paragraph","si":131321,"ei":131321,"sm":{"ps_lslm":1,"ps_awao_i":false,"ps_ifl":40.5,"ps_ls":1.0,"ps_lslm_i":false,"ps_sm":1,"ps_sm_i":false,"ps_ifl_i":false,"ps_ls_i":false,"ps_il_i":false,"ps_awao":true,"ps_il":58.5}},{"ty":"as","st":"list","si":131466,"ei":131466,"sm":{"ls_ts":{"ts_un":false,"ts_un_i":false,"ts_sc":false,"ts_it_i":false,"ts_fgc2":{"hclr_color":"#595959","clr_type":0},"ts_st_i":false,"ts_bgc2":{"hclr_color":null,"clr_type":0},"ts_fs_i":false,"ts_ff_i":false,"ts_bgc2_i":false,"ts_it":true,"ts_va":"nor","ts_bd_i":false,"ts_va_i":false,"ts_fs":10.0,"ts_ff":"Calibri","ts_st":f
