y or duration of these risks.\nExamples: inform the subjects about the risks and how to minimize them; require a pregnancy test before and during the study; require subjects to use contraception; advise subjects about banking of sperm and ova.\n\nIf the use of contraception will be required, describe the allowable methods and the time period when contraception must be used.\n\u0010\u0012\u001cClick or tap here to enter text.\n\u001110.2.c. Pregnancy. Describe what will be done if a subject (or a subject’s partner) becomes pregnant.\nFor example; will subjects be required to immediately notify study staff, so that the study procedures can be discontinue or modified, or for a discussion of risks, and/or referrals or counseling?\n\u0010\u0012\u001cClick or tap here to enter text.\n\u001110.3. [DETERMINATION]  MRI risk management. A rare but serious adverse reaction called nephrogenic systemic fibrosis (NSF) has been observed in individuals with kidney disease who received gadolinium-based contrast agents (GBCAs) for the scans. Also, a few healthy individuals have a severe allergic reaction to GBCAs.\n10.3.a. Use of gadolinium. Will any of the MRI scans involve the use of a gadolinium-based contrast agent (GBCA)?\n☐ No\n☐ Yes → Which agents will be used? Check all that apply.\n\u0010\u0012\u001cCheck all that apply\n\u001cBrand Name\n\u001cGeneric Name\n\u001cChemical Structure\n\u001c\n\u0012\u001c☐\n\u001cDotarem\n\u001cGadoterate meglumine\n\u001cMacrocylic\n\u001c\n\u0012\u001c☐\n\u001cEovist / Primovist\n\u001cGadoxetate disodium\n\u001cLinear\n\u001c\n\u0012\u001c☐\n\u001cGadavist\n\u001cGadobutro\n\u001cMacrocyclic\n\u001c\n\u0012\u001c☐\n\u001cMagnevist\n\u001cGadpentetate dimeglumine\n\u001cLinear\n\u001c\n\u0012\u001c☐\n\u001cMultiHance\n\u001cGadobenate dimeglumine\n\u001cLinear\n\u001c\n\u0012\u001c☐\n\u001cOmniscan\n\u001cGadodiamide\n\u001cLinear\n\u001c\n\u0012\u001c☐\n\u001cOptiMARK\n\u001cGadoversetamide\n\u001cLinear\n\u001c\n\u0012\u001c☐\n\u001cProHance\n\u001cGadoteridol\n\u001cMacrocyclic\n\u001c\n\u0012\u001c☐\n\u001cOther, provide name:\n\u001c\n\u001c\n\u001c\n\u0012\u001c\n\u001cClick or tap here to enter text.\n\u001c\n\u001c\n\u001110.3.a.1. The FDA has concluded that gadolinium is retained in the body and brain for a significantly longer time than previously recognized, especially for linear GBCAs. The health-related risks of this longer retention are not yet clearly established. However, the UW IRB expects researchers to provide a compelling justification for using a linear GBCA instead of a macrocyclic GBCA, to manage the risks associated with GBCAs.\nDescribe why it is important to use a GBCA with the MRI scan(s). Describe the dose that will be used and (if it is more than the standard clinical dose recommended by the manufacturer) why it is necessary to use a higher dose. If a linear GBCA will be used, explain why a macrocyclic GBCA cannot be used.\n\u0010\u0012\u001cClick or tap here to enter text.\n\u001110.3.a.2. Information for subjects. Confirm by checking this box that subjects will be provided with the FDA-approved Patient Medication Guide for the GBCA being used in the research or that the same information will be inserted into the consent form.\n☐ Confirmed\n10.3.b. Who will (1) calculate the dose of GBCA; (2) prepare it for injection; (3) insert and remove the IV catheter; (4) administer the GBCA; and (5) monitor for any adverse effects of the GCBA? Also, what are the qualifications and training of these individual(s)?\n\u0010\u0012\u001cClick or tap here to enter text.\n\u001110.3.c. Describe how the renal function of subjects will be assessed prior to MRI scans and how that information will be used to exclude subjects at risk for NSF.\n\u0010\u0012\u001cClick or tap here to enter text.\n\u001110.3.d. Describe the protocol for handling a severe allergic reaction to the GBCA or any other medical event/emergency during the MRI scan, including who will be responsible for which actions.\n\u0  procedures performed solely for research purposes (e.g., experimental liver dialysis, experimental brain stimulation)\nIf any of the boxes are checked:\nProvide the name and institutional affiliation of a physician anesthesiologist who is a member of the research team or who will serve as a safety consultant about the interactions between the research procedures and the general or regional anesthesia of the subject-patients. If the procedures will be performed at a UW Medicine facility or affiliate, the anesthesiologist must be a UW faculty member, and  the Vice Chair of Clinical Research in the UW Department of Anesthesiology and Pain Medicine must be consulted in advance for feasibility, safety and billing.\n\u0010\u0012\u001cClick or tap here to enter text.\n\u0011** If the box about radio-isotopes is checked, the study team is responsible for informing in advance all appropriate clinical personnel (e.g., nurses, technicians, anesthesiologists, surgeons) about the administration and use of the radio-isotope, to ensure that any personal safety issues (e.g., pregnancy) can be appropriately addressed. This is a condition of IRB approval.\n10.6. Data and Safety Monitoring. A Data and Safety Monitoring Plan (DSMP) is required for clinical trials (as defined by NIH). If required for this research, or if there is a DSMP for the research regardless of whether it is required, upload the DSMP to Zipline. If it is embedded in another document being uploading (for example, a Study Protocol) use the text box below to name the document that has the DSMP. Alternatively, provide a description of the DSMP in the text box below. For guidance on developing a DSMP, see the ITHS webpage on Data and Safety Monitoring Plans.\n\u0010\u0012\u001cN/A\n\u001110.7. Un-blinding. If this is a double-blinded or single-blinded study in which the participant and/or relevant study team members do not know the group to which the participant is assigned, describe the circumstances under which un-blinding would be necessary, and to whom the un-blinded information would be provided.\n\u0010\u0012\u001cN/A\n\u001110.8. Withdrawal of participants. If applicable, describe the anticipated circumstances under which participants will be withdrawn from the research without their consent. Also, describe any procedures for orderly withdrawal of a participant, regardless of the reason, including whether it will involve partial withdrawal from procedures and any intervention but continued data collection or long-term follow-up.\n\u0010\u0012\u001cN/A\n\u001110.9. [DETERMINATION]  Anticipated direct benefits to participants. If there are any direct research-related benefits that some or all individual participants are likely to experience from taking part in the research, describe them below:\nDo not include benefits to society or others, and do not include subject payment (if any). Examples: medical benefits such as laboratory tests (if subjects receive the results); psychological resources made available to participants; training or education that is provided.\n\u0010\u0012\u001cSubject may receive some direct benefit by being able to access the data generated by the study procedures (see section 10.10.b).\n\u001110.10. [DETERMINATION]  Return of individual research results.\nIn this section, provide your plans for the return of individual results. An “individual research result” is any information collected, generated or discovered in the course of a research study that is linked to the identity of a research participant. These may be results from screening procedures, results that are actively sought for purposes of the study, results that are discovered unintentionally, or after analysis of the collected data and/or results has been completed.\n"},{"ty":"ae","et":"bookmark","id":"id.5cqurz6d7rxk","epm":{}},{"ty":"ae","et":"bookmark","id":"id.dm1c8vgvccnf","epm":{}},{"ty":"ae","et":"bookmark","id":"id.fuqrie8s2uad","epm":{}},{"ty":"ae","et":"bookmark","id":"id.nltb9ly ment (CLIA), consent requirements and communicating results.\n10.10.a. Is it anticipated that the research will produce any individual research results that are clinically actionable?\n“Clinically actionable” means that there are established therapeutic or preventive interventions or other available actions that have the potential to change the clinical course of the disease/condition, or lead to an improved health outcome.\nIn general, every effort should be made to offer results that are clinically actionable, valid and pose life-threatening or severe health consequences if not treated or addressed quickly. Other clinically actionable results should be offered if this can be accomplished without compromising the research.\n☐ No\n☒ Yes → Answer the following questions (10.10.a.1 through 10.10.a.3.)\n10.10.a.1. Describe the clinically actionable results that are anticipated and explain which results, if any, could be urgent (i.e. because they pose life-threatening or severe health consequences if not treated or addressed quickly).\nExamples of urgent results include very high calcium levels, highly elevated liver function test results, positive results for reportable STDs.\n\u0010\u0012\u001cResults obtained during the study visit may be clinically actionable, such as blood pressure or visual acuity/eye exam data and will be shared with the study participants in real time. Each participant will receive a card with these results at the end of the visit. This includes vision or life threatening actionable incidental findings, e.g., retinal detachment, disc edema, or tumors, identified during the visit. In such cases, patients will be referred for treatment.\n\nDue to delay in obtaining the laboratory results and lack of standard interpretation methods for other data (e.g., imaging), it is unlikely that these data would be clinically actionable. All clinical laboratory results will be uploaded on a yearly basis, and participants will be able to access them (but there may be a substantial lag between the study visit and the yearly upload). \n\nCGM data will be shared with the participants, which may include data for up to 100 days of collection.\n\u001110.10.a.2. Explain which of these results will be offered to subjects.\n\u0010\u0012\u001cSubjects will receive results obtained on site during the visit (e.g., blood pressure or vision exam results), CGM data, and laboratory testing results; however, laboratory testing results may not be available within the clinically actionable timeline. The laboratory testing results will be available to subjects through the study database that is updated and uploaded yearly. Each subject will receive an access code. Normal range of values will be available for the laboratory results. All abnormal laboratory results will be marked/flagged, and it will be recommended that subjects use the information and discuss the results with their primary care provider or specialist. Study will not provide interpretation of the data due to the high number of subjects.\n\nThe portal will contain a disclaimer, instructing the subjects to review the provided information with their physician(s). \n\u001110.10.a.3. Explain which results will not be offered to subjects and provide the rationale for not offering these results.\nReasons not to offer the results might include:\nThere are serious questions regarding validity or reliability \nReturning the results has the potential to cause bias\nThere are insufficient resources to communicate the results effectively and appropriately\nKnowledge of the result could cause psychosocial harm to subjects\n\u0010\u0012\u001cOnly data obtained during the study visit exam (e.g., blood pressure, eye exam information), CGM data, and laboratory test results obtained from collected blood and urine samples will be offered to the participants. Since we are recruiting from the EMRs, not every patient is seen by a specialist at the study sites or has access to care from a specialty clinic. Thus, we will return the data that can be interpreted by a primary care doctor. In addition, we are not distributing any test results that do not have standard interpretation methods (e.g., retinal images, fitness tracking).\n\u0011"},{"ty":"ae","et":"bookmark","id":"id.dvr4nko7ngvo","epm":{}},{"ty":"ae","et":"bookmark","id":"id.p1vobhsf63s8","epm":{}},{"ty":"ae","et":"bookmark","id":"id.s5vjk35jwnx2","epm":{}},{"ty":"ae","et":"bookmark","id":"id.w48tzmfqakh6","epm":{}},{"ty":"ae","et":"list","id":"kix.list.33","epm":{"le_nb":{"nl_4":{"b_gf":"%4","b_ts":{"ts_un":false,"ts_un_i":true,"ts_sc":false,"ts_it_i":true,"ts_fgc2":{"hclr_color":"#000000","clr_type":0},"ts_st_i":true,"ts_bgc2":{"hclr_color":null,"clr_type":0},"ts_fs_i":true,"ts_ff_i":false,"ts_bgc2_i":true,"ts_it":false,"ts_va":"nor","ts_bd_i":true,"ts_va_i":true,"ts_fs":11.0,"ts_ff":"Courier New","ts_st":false,"ts_bd":false,"ts_fgc2_i":true,"ts_sc_i":true,"ts_tw":400},"b_ifl":310.5,"b_gs":"o","b_a":0,"b_sn":1,"b_gt":9,"b_il":328.5},"nl_3":{"b_gf":"%3","b_ts":{"ts_un":false,"ts_un_i":true,"ts_sc":false,"ts_it_i":true,"ts_fgc2":{"hclr_color":"#000000","clr_type":0},"ts_st_i":true,"ts_bgc2":{"hclr_color":null,"clr_type":0},"ts_fs_i":true,"ts_ff_i":false,"ts_bgc2_i":true,"ts_it":false,"ts_va":"nor","ts_bd_i":true,"ts_va_i":true,"ts_fs":11.0,"ts_ff":"Noto Sans Symbols","ts_st":false,"ts_bd":false,"ts_fgc2_i":true,"ts_sc_i":true,"ts_tw":400},"b_ifl":274.5,"b_gs":"●","b_a":0,"b_sn":1,"b_gt":9,"b_il":292.5},"nl_2":{"b_gf":"%2","b_ts":{"ts_un":false,"ts_un_i":true,"ts_sc":false,"ts_it_i":true,"ts_fgc2":{"hclr_color":"#000000","clr_type":0},"ts_st_i":true,"ts_bgc2":{"hclr_color":null,"clr_type":0},"ts_fs_i":true,"ts_ff_i":false,"ts_bgc2_i":true,"ts_it":false,"ts_va":"nor","ts_bd_i":true,"ts_va_i":true,"ts_fs":11.0,"ts_ff":"Noto Sans Symbols","ts_st":false,"ts_bd":false,"ts_fgc2_i":true,"ts_sc_i":true,"ts_tw":400},"b_ifl":238.5,"b_gs":"▪","b_a":0,"b_sn":1,"b_gt":9,"b_il":256.5},"nl_1":{"b_gf":"%1","b_ts":{"ts_un": able?\nExamples: non-actionable genetic results, clinical tests in the normal range, experimental and/or uncertain results.\n☐ No\n☒ Yes → Explain which results will be offered to subjects and provide the rationale for offering these results.\n\u0010\u0012\u001cSubjects will receive results of the tests listed under 10.10.a.2, some of which may be within the normal range. The study team will not curate the results in any way and therefore cannot exclude results that are normal and do not require treatment or intervention. Knowing that their values are normal may be reassuring to the subjects. Furthermore, these normal findings may serve as baseline in case of any future abnormal findings.\n\u001110.10.c. Describe the validity and reliability of any results that will be offered to subjects.\nThe IRB will consider evidence of validity such as studies demonstrating diagnostic, prognostic, or predictive value, use of confirmatory testing, and quality management systems.\n\u0010\u0012\u001cReference ranges for laboratory testing will be provided. \n\u001110.10.d. Describe the process for communicating results to subjects and facilitating understanding of the results. In the description, include who will approach the participant with regard to the offer of results, who will communicate the result (if different), the circumstances, timing, and communication methods that will be used.\n\u0010\u0012\u001cAs stated in 10.10.b, participants will be able to access the data via an electronic database and discuss any test results with their clinical care providers. Data access will be provisioned upon completion of all study procedures, and a secure e-mail will be sent by study staff with database access details. Study staff will communicate database access details when data are available, but will not provide any clinical interpretations.\n\u001110.10.e. Describe any plans to share results with family members (e.g. in the event a subject becomes incapacitated or deceased).\n\u0010\u0012\u001cWe do not have plans to share results with family members.\n\u001110.10.f. Check the box to indicate that any plans for return of individual research results have been described in the consent document. If there are no plans to provide results to participants, this should be stated in the consent form.\nSee the GUIDANCE Return of Individual Results for information about consent requirements.\n☒ Confirmed\n10.11. Commercial products or patents. Is it possible that a commercial product or patent could result from this study?\n☐ No\n☒ Yes → Describe whether subjects might receive any remuneration/compensation and, if yes, how the amount will be determined.\n\u0010\u0012\u001cThere are no plans for the researchers involved in collecting the data set to develop any commercial products or file for patents. However, the data set will be publicly available with a commercial-friendly open-source license and there may be products or patents that are developed from it in the future.\n\u0011 11. ECONOMIC BURDEN TO PARTICIPANTS\n11.1. Financial responsibility for research-related injuries. Answer this question only if the lead researcher is not a UW student, staff member, or faculty member whose primary paid appointment is at the UW.\nFor each institution involved in conducting the research: Describe who will be financially responsible for research-related injuries experienced by subjects, and any limitations. Describe the process (if any) by which participants may obtain treatment/compensation.\n\u0010\u0012\u001cClick or tap here to enter text.\n\u001111.2. Costs to subjects. Describe any research-related costs for which subjects and/or their health insurance may be responsible (examples might include: CT scan required for research eligibility screening; co-pays; surgical costs when a subject is randomized to a specific procedure; cost of a device; travel and parking expenses that will not be reimbursed).\n\u0010\u0012\u001cSubjects may incur costs for transport rform, and the qualifications or training that are relevant to performing those study activities.\n\u0010\u0012\u001cExamples: \nResearch Study Coordinator: Obtain consent, administer surveys, blood draw. Will have previous experience coordinating clinical research and be a certified phlebotomist in WA.\nUndergraduate Research Assistant: Obtain consent, perform all study procedures. Will have had coursework in research methods, complete an orientation to human subjects protections given by the department, and will receive training from the PI or the graduate student project lead on obtaining consent and debriefing subjects.\nAcupuncturist: Perform acupuncture procedures and administer surveys. Must be licensed with WA State DoH and complete training in administering research surveys given by the project director, an experienced survey researcher.\nCo-Investigator: Supervise MRI and CT scan procedures and data interpretation, obtain consent. MD, specialty in interventional radiology and body imaging. 5-years clinical research experience.\n\u0011\n\u0010\u0012\u001cPrincipal Investigators/ Co-Principal/ Co-Investigator: Make executive decision pertaining to the scope of the project including data collection, curation, and processing\n\nProgram/project manager: Oversee data collection and management of research coordinators/project managers, make project related decisions in collaboration with the investigators, oversee integration and collaboration between all study members and modules\n\nDatabase manager: Ingest data into the Redcap database and extract for processing\n\nResearch/Data scientist/Postdoctoral Fellow: Process data for release in database and development of standards\n\nClinical research coordinator/study coordinator: Responsible for contacting and consenting the research participants, ushering participants through the research visit, conducting study visits including collection of ophthalmologic images, providing training on study procedures such as continuous glucose monitoring or fitness tracker, and ensuring the return of all study materials (ex. Environmental sensor)\n\nResearch assistant: Conduct study visits including collection of ophthalmologic images, provide training on study procedures such as continuous glucose monitoring or fitness tracker, ensure the return of all study materials (ex. Environmental sensor) under the direction of the study coordinator or project manager; responsible for data upload and management from each clinic visit\n\nSoftware engineer: Responsible for designing, implementing, and testing the different data\ncuration pipelines \n\nCloud engineer: Responsible for cloud infrastructure customization, configuration and deployment including integrating, configuring, deploying, and managing centrally provided common cloud services\n\nPhlebotomist: Responsible for blood collection from research participants\n\nLab Assistant: Responsible for processing and shipping samples\n\nDomain experts: Provide guidance on issues arising from collecting data from each domain of medicine such as endocrinology and cardiology.\n\u0011"},{"ty":"ae","et":"bookmark","id":"id.1zr2bojvubpa","epm":{}},{"ty":"ae","et":"bookmark","id":"id.d3wm9999ucar","epm":{}},{"ty":"ae","et":"bookmark","id":"id.lbnruntsowye","epm":{}},{"ty":"ae","et":"list","id":"kix.list.34","epm":{"le_nb":{"nl_4":{"b_gf":"%4","b_ts":{"ts_un":false,"ts_un_i":true,"ts_sc":false,"ts_it_i":true,"ts_fgc2":{"hclr_color":"#000000","clr_type":0},"ts_st_i":true,"ts_bgc2":{"hclr_color":null,"clr_type":0},"ts_fs_i":true,"ts_ff_i":false,"ts_bgc2_i":true,"ts_it":false,"ts_va":"nor","ts_bd_i":true,"ts_va_i":true,"ts_fs":11.0,"ts_ff":"Courier New","ts_st":false,"ts_bd":false,"ts_fgc2_i":true,"ts_sc_i":true,"ts_tw":400},"b_ifl":189.0,"b_gs":"o","b_a":0,"b_sn":1,"b_gt":9,"b_il":207.0},"nl_3":{"b_gf":"%3","b_ts":{"ts_un":false,"ts_un_i":true,"ts_sc":false,"ts_it_i":true,"ts_fgc2":{"hclr_color":"#000000","clr_type":0},"ts_st_i":true,"ts_bgc2":{"hclr_color":n
